import React from "react"
import Button from 'react-bootstrap/Button';
import Card from "../components/Card";
import styled from "styled-components";

const Movie = () => {

    return (
        <Container>
            <Card style={{ width: '18rem' }}>
            <Card.Img variant="top" src="holder.js/100px180" />
            <Card.Body>
                <Card.Title>Card Title</Card.Title>
                <Card.Text>
                Some quick example text to build on the card title and make up the
                bulk of the card's content.
                </Card.Text>
                <Button variant="primary">Go somewhere</Button>
            </Card.Body>
            </Card>
            <div className="flex column">
                <img src="https://external-preview.redd.it/qKqDBJXUFlCGtmXyMd3YKnEXvMkv0DRTvH1h7RQe-FU.jpg?auto=webp&s=3a00ebfc084ae73836088232c50069cca9c90631" alt="" />
            </div>
            <div className="jam">
                <h2>14 November 2022</h2>
                <Button variant="light">12.03</Button>{' '}
                <Button variant="light">13.10</Button>{' '}
                <Button variant="light">14.25</Button>{' '}
                <Button variant="light">15.30</Button>{' '}
                <Button variant="light">17.00</Button>{' '}
                <Button variant="light">19.10</Button>{' '}
                <Button variant="light">20.20</Button>{' '}
            </div>
        </Container>
    )
}

const Container = styled.div`
.jam {
  margin: auto;
  font-size: 1rem;
}
`;

export default Movie










